const songListReducer = () => {
  return [
    {title: 'This is cool', length: '5min', artist: 'Lisa'},
    {title: 'This sucks', length: '4min', artist: 'Bob'},
    {title: 'Wait a sec', length: '3.5min', artist: 'Someone'},
    {title: 'Nvm', length: '10min', artist: 'Lulz'}
  ]
}


export default songListReducer
